import React from 'react';
import {PropTypes} from 'prop-type';


function Input({addPost}){
    return (
        <div className="Input">
            <div className="Input_header">Create Post</div>
            <input 
                className="Input_field"
                type="text"
            />
        </div>
    );
}

Input.propTypes = {
    addPost: PropTypes.func.isRequired
}

export default Input;
